import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_viewport.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_viewport.png'));

    // Wait for and click mobile menu button
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to open and take screenshot
    await page.waitForSelector('.mobile-menu-overlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_open.png'));

    // Extract menu items to verify menu content
    const menuItems = await page.$$eval('.mobile-menu a', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Click on Electronics category in mobile menu
    await page.waitForSelector('a[href="#"]:has-text("Electronics")', { timeout: 5000 });
    await page.click('a[href="#"]:has-text("Electronics")');

    // Wait for navigation and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_electronics_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_electronics_selected.png'));

    // Close mobile menu
    await page.waitForSelector('.close-mobile-menu', { timeout: 5000 });
    await page.click('.close-mobile-menu');

    // Wait for menu to close and take final screenshot
    await page.waitForSelector('.mobile-menu-overlay:not(.show)', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation by opening menu, selecting Electronics category, and closing menu",
      extractedData: {
        menuItems: menuItems.slice(0, 5) // First 5 menu items
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
